angular.module("key-value-editor").run(["$templateCache", function($templateCache) {$templateCache.put("key-value-editor.html","<div class=\"row\" ng-class-odd=\"\'odd\'\" ng-class-even=\"\'even\'\" ng-repeat=\"pair in pairs track by $index\">\n  <div class=\"form-group col-xs-5\">\n    <input\n      type=\"text\"\n      class=\"form-control\"\n      id=\"key-{{$id}}\"\n      placeholder=\"{{keyPlaceholder}}\"\n      value={{pair[0]}}\n      ng-focus=\"$last && onFocusLast($last, $index)\">\n  </div>\n  <div class=\"form-group col-xs-5\">\n    <input\n      type=\"text\"\n      class=\"form-control\"\n      id=\"value-{{$id}}\"\n      placeholder=\"{{valuePlaceholder}}\"\n      value={{pair[1]}}\n      ng-focus=\"$last && onFocusLast($last, $index)\">\n  </div>\n  <div class=\"col-xs-2\">\n    <span class=\"fa fa-bars\" aria-hidden=\"true\"></span>\n    <button type=\"submit\" class=\"btn btn-default\"><span class=\"fa fa-trash-o\" aria-hidden=\"true\"></span></button>\n  </div>\n</div>\n");}]);